export function ContactPicker({contacts, setContact}) {

    return (
        <div>
            <select id='contactPicker' name='contactPicker' >
                {
                    contacts.map((el,index) => {
                        if(index === 0) {
                            return <option key={index} value='Select a contact'>Select a contact</option>
                        }return <option key={index} value={el.name}>{el.name}</option>
                    })
                }
            </select>
        </div>
    )
}
